export const rightToc = [{
  value: 'Agent 无法连接 Rancher server',
  id: 'agent-无法连接-rancher-server',
  children: [{
    value: 'ERROR: <code>https://x.x.x.x/ping</code> is not accessible (Failed to connect to x.x.x.x port 443: Connection timed out)',
    id: 'error-httpsxxxxping-is-not-accessible-failed-to-connect-to-xxxx-port-443-connection-timed-out',
    children: []
  }, {
    value: 'ERROR: <code>https://rancher.my.org/ping</code> is not accessible (Could not resolve host: rancher.my.org)',
    id: 'error-httpsranchermyorgping-is-not-accessible-could-not-resolve-host-ranchermyorg',
    children: []
  }]
}, {
  value: '创建 Kubernetes 集群，ETCD 无法启动',
  id: '创建-kubernetes-集群，etcd-无法启动',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "agent-无法连接-rancher-server"
    }}>{`Agent 无法连接 Rancher server`}</h2>
    <h3 {...{
      "id": "error-httpsxxxxping-is-not-accessible-failed-to-connect-to-xxxx-port-443-connection-timed-out"
    }}>{`ERROR: `}<inlineCode parentName="h3">{`https://x.x.x.x/ping`}</inlineCode>{` is not accessible (Failed to connect to x.x.x.x port 443: Connection timed out)`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`ERROR: https://x.x.x.x/ping is not accessible (Failed to connect to x.x.x.x port 443: Connection timed out)
`}</code></pre>
    <p>{`在`}<inlineCode parentName="p">{`cattle-cluster-agent`}</inlineCode>{`或`}<inlineCode parentName="p">{`cattle-node-agent`}</inlineCode>{`中出现以上错误，代表 agent 无法连接到 rancher server，请按照以下步骤排查网络连接：`}</p>
    <ul>
      <li parentName="ul">{`从 agent 宿主机访问 rancher server 的 443 端口，例如：`}<inlineCode parentName="li">{`telnet x.x.x.x 443`}</inlineCode></li>
      <li parentName="ul">{`从容器内访问 rancher server 的 443 端口，例如：`}<inlineCode parentName="li">{`telnet x.x.x.x 443`}</inlineCode></li>
    </ul>
    <h3 {...{
      "id": "error-httpsranchermyorgping-is-not-accessible-could-not-resolve-host-ranchermyorg"
    }}>{`ERROR: `}<inlineCode parentName="h3">{`https://rancher.my.org/ping`}</inlineCode>{` is not accessible (Could not resolve host: rancher.my.org)`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`ERROR: https://rancher.my.org/ping is not accessible (Could not resolve host: rancher.my.org)
`}</code></pre>
    <p>{`在`}<inlineCode parentName="p">{`cattle-cluster-agent`}</inlineCode>{`或`}<inlineCode parentName="p">{`cattle-node-agent`}</inlineCode>{`中出现以上错误，代表 agent 无法通过域名解析到 rancher server，请按照以下步骤进行排查网络连接：`}</p>
    <ul>
      <li parentName="ul">{`从容器内访问通过域名访问 rancher server，例如：`}<inlineCode parentName="li">{`ping rancher.my.org`}</inlineCode></li>
    </ul>
    <p>{`这个问题在内网并且无 DNS 服务器的环境下非常常见，即使在/etc/hosts 文件中配置了映射关系也无法解决，这是因为`}<inlineCode parentName="p">{`cattle-node-agent`}</inlineCode>{`从宿主机的/etc/resolv.conf 中继承`}<inlineCode parentName="p">{`nameserver`}</inlineCode>{`用作 dns 服务器。`}</p>
    <p>{`所以要解决这个问题，可以在环境中搭建一个 dns 服务器，配置正确的域名和 IP 的对应关系，然后将每个节点的`}<inlineCode parentName="p">{`nameserver`}</inlineCode>{`指向这个 dns 服务器。`}</p>
    <p>{`或者使用`}<a parentName="p" {...{
        "href": "https://kubernetes.io/zh/docs/concepts/services-networking/add-entries-to-pod-etc-hosts-with-host-aliases/"
      }}>{`HostAliases`}</a></p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`kubectl -n cattle-system patch  deployments cattle-cluster-agent --patch '{
    "spec": {
        "template": {
            "spec": {
                "hostAliases": [
                    {
                      "hostnames":
                      [
                        "{{ rancher_server_hostname }}"
                      ],
                      "ip": "{{ rancher_server_ip }}"
                    }
                ]
            }
        }
    }
}'

kubectl -n cattle-system patch  daemonsets cattle-node-agent --patch '{
 "spec": {
     "template": {
         "spec": {
             "hostAliases": [
                 {
                    "hostnames":
                      [
                        "{{ rancher_server_hostname }}"
                      ],
                    "ip": "{{ rancher_server_ip }}"
                 }
             ]
         }
     }
 }
}'
`}</code></pre>
    <h2 {...{
      "id": "创建-kubernetes-集群，etcd-无法启动"
    }}>{`创建 Kubernetes 集群，ETCD 无法启动`}</h2>
    <p>{`通过`}<a parentName="p" {...{
        "href": "/docs/rancher2/cluster-provisioning/rke-clusters/_index"
      }}>{`rke 创建 Kubernetes 集群`}</a>{`，集群状态为`}<inlineCode parentName="p">{`Provisioning`}</inlineCode>{`，并且 UI 显示如下错误信息：`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`[etcd] Failed to bring up Etcd Plane: etcd cluster is unhealthy: hosts [10.0.2.15] failed to report healthy. Check etcd container logs on each host for more information
`}</code></pre>
    <p>{`查看 etcd 日志，显示如下错误信息：`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`2020-05-25 08:43:41.515364 I | embed: ready to serve client requests
2020-05-25 08:43:41.523589 I | embed: serving client requests on [::]:2379
2020-05-25 08:43:41.536538 I | embed: rejected connection from "10.0.2.15:39550" (error "tls: failed to verify client's certificate: x509: certificate signed by unknown authority (possibly because of \\"crypto/rsa: verification error\\" while trying to verify candidate authority certificate \\"kube-ca\\")", ServerName "")
2020-05-25 08:43:46.545930 I | embed: rejected connection from "10.0.2.15:39554" (error "tls: failed to verify client's certificate: x509: certificate signed by unknown authority (possibly because of \\"crypto/rsa: verification error\\" while trying to verify candidate authority certificate \\"kube-ca\\")", ServerName "")
2020-05-25 08:43:51.554070 I | embed: rejected connection from "10.0.2.15:39556" (error "tls: failed to verify client's certificate: x509: certificate signed by unknown authority (possibly because of \\"crypto/rsa: verification error\\" while trying to verify candidate authority certificate \\"kube-ca\\")", ServerName "")
2020-05-25 08:44:34.072012 I | embed: rejected connection from "10.0.2.15:39703" (error "EOF", ServerName "")
2020-05-25 08:44:46.520865 I | embed: rejected connection from "10.0.2.15:39560" (error "tls: failed to verify client's certificate: x509: certificate signed by unknown authority (possibly because of \\"crypto/rsa: verification error\\" while trying to verify candidate authority certificate \\"kube-ca\\")", ServerName "")
`}</code></pre>
    <p>{`以上报错是因为证书的问题，导致 etcd 启动失败。原因主要有两种可能：`}</p>
    <ol>
      <li parentName="ol">{`主机时钟不同步`}</li>
      <li parentName="ol">{`该主机之前添加过 kubernetes 集群，在残留数据没有清理干净的情况下重新安装集群。`}</li>
    </ol>
    <p><strong parentName="p">{`解决办法：`}</strong></p>
    <ol>
      <li parentName="ol">{`检查主机时钟，并使各主机时钟同步。`}</li>
      <li parentName="ol">{`参考`}<a parentName="li" {...{
          "href": "/docs/rancher2/cluster-admin/cleaning-cluster-nodes/_index"
        }}>{`清理节点`}</a>{`说明，将主机数据残留数据清理干净，然后再从新添加集群。`}</li>
    </ol>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
